description:
Outdoor living is one of the stronger categories in the house and home market; we also know that outdoor projects that are quick and inexpensive to build are particularly popular with cash-strapped homeowners. Outdoor Wood Projects will feature 24 projects for the backyard and garden that can be completed with basic DIY tooling, inexpensive materials, and beginner skills--and that should take no more than a weekend to build. Projects are grouped into the following categories: planters, window boxes, trellises, and outdoor furniture; and there is also a whole chapter devoted to projects built with bamboo. A number of the projects are constructed from reclaimed or recycled wood (such as an Adirondack chair made from wood pallets).

Outdoor Wood Projects - 24 Projects You Can Build in a Weekend
